def split_reviews():
    reviewArr = reviewString.split(" ")
    splitArr = []
    for num in range(int(len(reviewArr) / 100)):
        rand = int(random.random()*50 + 50)
        splitArr.append(reviewArr[num * rand:num * rand + rand])
    return splitArr


def combine_strings():
    rev_list = []
    for elem in split_reviews():
        rev = " ".join(elem)
        rev = rev.lower()
        rev_list.append(rev)
    return rev_list
